  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `batch_operation_id` varchar(400) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '作业批次号',
